import React, { useState } from "react";

const AdminLayout = ({ children }) => {
  const [isSidebarCollapsed, setIsSidebarCollapsed] = useState(false);
  const [searchOpen, setSearchOpen] = useState(false);

  const toggleSidebar = () => {
    setIsSidebarCollapsed(!isSidebarCollapsed);
  };

  return (
    <div className="min-h-screen flex">
      {/* Sidebar */}
      <div
        className={`bg-white border-r ${
          isSidebarCollapsed ? "w-20" : "w-64"
        } transition-all duration-300 flex flex-col`}
      >
        {/* Sidebar Header */}
        <div className="p-4 flex items-center border-b">
          <img src="/api/placeholder/32/32" alt="logo" className="h-8 w-8" />
          {!isSidebarCollapsed && (
            <h4 className="ml-2 text-xl font-semibold">Rukada</h4>
          )}
          <button
            onClick={toggleSidebar}
            className="ml-auto text-gray-500 hover:text-gray-700"
          >
            <Menu size={20} />
          </button>
        </div>

        {/* Navigation */}
        <nav className="flex-1 overflow-y-auto py-4">
          <ul className="space-y-2 px-3">
            {/* Dashboard */}
            <li className="mb-4">
              <div className="flex items-center px-4 py-2 text-gray-700 hover:bg-gray-100 rounded-lg">
                <Home size={20} />
                {!isSidebarCollapsed && <span className="ml-3">Dashboard</span>}
              </div>
            </li>

            {/* Applications */}
            <li className="mb-4">
              <div className="flex items-center px-4 py-2 text-gray-700 hover:bg-gray-100 rounded-lg">
                <Category size={20} />
                {!isSidebarCollapsed && (
                  <span className="ml-3">Applications</span>
                )}
              </div>
            </li>

            {/* eCommerce */}
            <li className="mb-4">
              <div className="flex items-center px-4 py-2 text-gray-700 hover:bg-gray-100 rounded-lg">
                <ShoppingCart size={20} />
                {!isSidebarCollapsed && <span className="ml-3">eCommerce</span>}
              </div>
            </li>
          </ul>
        </nav>
      </div>

      {/* Main Content */}
      <div className="flex-1">
        {/* Header */}
        <header className="bg-white border-b">
          <div className="flex items-center justify-between px-6 py-4">
            <button className="lg:hidden" onClick={toggleSidebar}>
              <Menu size={24} />
            </button>

            {/* Search */}
            <div className="flex-1 max-w-xl mx-4">
              <div className="relative">
                <input
                  type="text"
                  className="w-full px-4 py-2 rounded-lg border focus:outline-none focus:border-blue-500"
                  placeholder="Search..."
                />
              </div>
            </div>

            {/* User Profile */}
            <div className="flex items-center space-x-4">
              <div className="relative">
                <button className="p-2 hover:bg-gray-100 rounded-full">
                  <MessageSquare size={20} />
                </button>
                <span className="absolute top-0 right-0 h-4 w-4 bg-red-500 rounded-full text-xs text-white flex items-center justify-center">
                  3
                </span>
              </div>

              <div className="flex items-center space-x-3">
                <img
                  src="/api/placeholder/32/32"
                  alt="user"
                  className="h-8 w-8 rounded-full"
                />
                <div className="hidden md:block">
                  <p className="text-sm font-medium">Pauline Seitz</p>
                  <p className="text-xs text-gray-500">Web Designer</p>
                </div>
              </div>
            </div>
          </div>
        </header>

        {/* Page Content */}
        <main className="p-6 bg-gray-50 min-h-[calc(100vh-4rem)]">
          {children}
        </main>
      </div>
    </div>
  );
};

export default AdminLayout;
